filters:
 - '='
comment: |-
  SELECT DISTINCT T1.Maker
  FROM CAR_MAKERS AS T1
  JOIN MODEL_LIST AS T2 ON T1.Id = T2.Maker
  JOIN CAR_NAMES AS T3 ON T2.model = T3.model
  JOIN CARS_DATA AS T4 ON T3.MakeId = T4.id
  WHERE T4.year = '1970';

sql: |-
  SELECT DISTINCT T1.Maker
  FROM CAR_MAKERS AS T1
